import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {

    }
  }

  changeNumber = (number) => {
      this.setState({
        number: number
      });
    };

    render() {
      return (
        <div>
        <h4>Current Number: {this.state.number}</h4>
        <a onClick={this.changeNumber(5)}>5</a>
        <a onClick={this.changeNumber(2)}>2</a>
        <a onClick={this.changeNumber(4)}>4</a>
        </div>
      )
    }
};

export default App;
